import axios from 'axios';
import { useNavigate } from 'react-router-dom';




const Logout = async () => {
    const history = useNavigate();
    try {
        await axios.delete('http://localhost:5000/logout');
        history.push("/");
    } catch (error) {
        console.log(error);
    }
}

export default Logout;
